import HomeScreen from "./screens/HomeScreen";
import { BrowserRouter as Routes, Route, BrowserRouter, useNavigate, } from 'react-router-dom';
import ProductScreen from "./screens/ProductScreen";
import ContactScreen from "./screens/ContactScreen";
import CategoryScreen from "./screens/CategoryScreen";
import Navbar from "./components/Navbar";
import { faShoppingCart } from '@fortawesome/fontawesome-free-solid';
import loggo from "./loggo.svg";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

export default function App() {
  let navigate = useNavigate();
  return (
    <Routes>
      <header>
        <Route>
          <a href='/home' onClick={() => {
            navigate(<HomeScreen />)
          }}>
            <img className='logo' src={loggo} alt="description" />
          </a>
        </Route>
        <Route>
          <div className="dropdown">
            <button className="dropbtn">SHOP</button>
            <div className="dropdown-content">
              <a href="Annual-Flowers" onClick={() => {
                navigate("/home/products/Annual-Flowers")
              }}>Annual Flowers</a>
              <a href="Garden-Plants-&-Flowers" onClick={() => {
                navigate("/home/products/Garden-Plants-&-Flowers")
              }}>Garden Plants & Flowers</a>
              <a href="Garden-Supplies-&-Plant-Care" onClick={() => {
                navigate("/home/products/Garden-Supplies-&-Plant-Care")
              }}>Garden Supplies & Plant Care</a>
            </div>
          </div>
        </Route>
        <Route>
        <div>
          <a href="Contact" onClick={() => {
            navigate("/home/Contact")
          }}>CONTACT</a>
        </div>
        </Route>
        <div className='options'>ACCOUNT</div>
        <div className='options'>LOGIN</div>
        <FontAwesomeIcon icon={faShoppingCart} />
      </header>
      <Route path='/home' element={<HomeScreen />} />
      <Route path="/home/products/:categorySlug/" element={<CategoryScreen />} />
      <Route path="/home/products/:category/:slug" element={<ProductScreen />} />
      <Route path='home/Contact' element={<ContactScreen />} />
    </Routes>
  )
}
